import React from 'react';
import Layout from '../../components/layout/index';
import { Typography, Divider } from 'antd';
import { Input } from 'antd';
import { UserOutlined } from '@ant-design/icons';
import {RiLockPasswordLine} from 'react-icons/ri'

const { Text } = Typography

const Register = () => {
    return (
        <Layout title='Cadastrar Usuário'>
            <Divider/>
            <div style={{ width: '100%', height: '100%', display:'flex', flexDirection:'column' }}>
                
                <Text strong>Usuário:</Text>
                <Input size="large" style={{width:'500px'}} placeholder="Nome do usuário" prefix={<UserOutlined />} />
                <br/>
                <Text strong>Senha:</Text>
                <Input.Password size="large" style={{width:'500px'}} placeholder="large size" prefix={<RiLockPasswordLine />} />
                <br/>
            </div>
        </Layout>
    )
}

export default Register;
